import React from "react";

const Todo = () => {
  return (
    <li className="todo-item">
      Heyy
      <button className="complete-btn">
        <i className="fas fa-check"></i>
      </button>
      <button className="trash-button">
        <i className="fas fa-trash"></i>
      </button>
    </li>
  );
};

export default Todo;
